#[derive(Copy, Clone)]
pub struct PersonalInfo {
    ability: [u16; 3],
    item: [u16; 3],
    form_count: u8,
    form_stat_index: u16,
    hatch_specie: u16,
    stats: [u8; 6],
    present: bool,
    gender: u8,
    types: [u8; 2],
}

impl PersonalInfo {
    #[allow(clippy::too_many_arguments)]
    const fn new(
        stats: [u8; 6],
        types: [u8; 2],
        items: [u16; 3],
        gender: u8,
        abilities: [u16; 3],
        form_count: u8,
        form_stat_index: u16,
        hatch_specie: u16,
        present: u8,
    ) -> Self {
        Self {
            ability: abilities,
            item: items,
            form_count,
            form_stat_index,
            hatch_specie,
            stats,
            present: present == 1,
            gender,
            types,
        }
    }

    pub const fn get_ability(&self, index: usize) -> u16 {
        self.ability[index]
    }

    pub const fn get_item(&self, index: usize) -> u16 {
        self.item[index]
    }

    pub const fn get_form_count(&self) -> u8 {
        self.form_count
    }

    pub const fn get_form_stats_index(&self) -> u16 {
        self.form_stat_index
    }

    pub const fn get_gender(&self) -> u8 {
        self.gender
    }

    pub const fn get_hatch_specie(&self) -> u16 {
        self.hatch_specie
    }

    pub const fn get_present(&self) -> bool {
        self.present
    }

    pub const fn get_stats(&self) -> [u8; 6] {
        self.stats
    }

    pub const fn get_stat(&self, index: usize) -> u8 {
        self.stats[index]
    }

    pub const fn get_type(&self, index: usize) -> u8 {
        self.types[index]
    }
}
